import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline"; // Per un reset CSS di base

// Crea un tema Material-UI personalizzato (opzionale, ma consigliato)
const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2', // Un blu più scuro
    },
    secondary: {
      main: '#dc004e', // Un rosa acceso
    },
  },
});

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <ThemeProvider theme={theme}>
      <CssBaseline /> {/* Applica un reset CSS di base per coerenza */}
      <App />
    </ThemeProvider>
  </React.StrictMode>
);
